                        "level": 6,
                        "desc": "Activates the Phlogiston Stereo DJ Controller (Portable) at full power, dealing Nightsoul-aligned <color=#FFE699FF>AoE Geo DMG</color> based on Xilonen's DEF.\\n\\nAdditionally, she will trigger the following effects based on her different Source Samples:\\nÂ·If she has at least 2 Source Samples that have had their Elemental Types changed, Xilonen will play an Ebullient rhythm, healing nearby active characters at intervals based on her DEF.\\nÂ·If she has fewer than 2 Source Samples that have had their Elemental Types changed, Xilonen will start up an Ardent rhythm, which will play two additional beats that deal Nightsoul-aligned <color=#FFE699FF>AoE Geo DMG</color> based on her DEF.\\n\\n<i>\"Alright, time for a time-out!\"\\n\"It's cool, I recorded those beats just now. Let's see what we get when we mix our rhythms!\"</i>",
