                        "skill_id": 30000,
                        "skill_type": 1,
                        "level": 6,
                        "desc": "<color=#FFD780FF>Normal Attack</color>\\nPerforms up to 3 attacks that deal <color=#80C0FFFF>Hydro DMG</color>.\\n\\n<color=#FFD780FF>Charged Attack</color>\\nConsumes a certain amount of Stamina to smack a Pufferball into the air that deals <color=#80C0FFFF>AoE Hydro DMG</color> upon landing.\\n\\n<color=#FFD780FF>Plunging Attack</color>\\nGathers the power of Hydro and plunges towards the ground from mid-air, damaging all opponents in her path. Deals <color=#80C0FFFF>AoE Hydro DMG</color> upon impact with the ground.",
