                        "desc": "Rushes forward, dealing <color=#99FF88FF>Dendro DMG</color> to nearby opponents when the rush ends, causing a Chisel-Light Mirror to form.\\nHolding this skill will cause it to behave differently.\\n\\n<color=#FFD780FF>Hold</color>\\nEnters Aiming Mode to adjust the direction of Alhaitham's rush attack.\\n\\n<color=#FFD780FF>Chisel-Light Mirror</color>\\nWhen this skill is unleashed, Alhaitham will generate 1 Chisel-Light Mirror. If there are no Mirrors at this time, he will generate 1 additional Mirror. Chisel-Light Mirrors will have the following properties:\\nÂ·When he possesses Chisel-Light Mirrors, Alhaitham's Normal, Charged, and Plunging Attacks will be converted to <color=#99FF88FF>Dendro DMG</color>. This cannot be overridden.\\nÂ·When attacks of the aforementioned kind hit opponents, the Chisel-Light Mirrors will unleash a Projection Attack that deals <color=#99FF88FF>AoE Dendro DMG</color> based on the number of Mirrors on the field.\\nÂ·A total of 3 Chisel-Light Mirrors can exist at once.\\nÂ·The Chisel-Light Mirrors will disappear one after the other over time, and will all disappear when Alhaitham leaves the field.\\n\\n<i>\"Truth inherently exists amidst uncertainty. Even the greatest of scholars are not immune to error.\"</i>",
