                        "skill_id": 10752,
                        "skill_type": 1,
                        "level": 10,
                        "desc": "Concentrates the power of the winds to break free from the shackles of the earth, dealing <color=#80FFD7FF>AoE Anemo DMG</color> before leaping into the air and entering the Windfavored state.\\n\\n<color=#FFD780FF>Windfavored</color>\\nThe Wanderer cannot perform Plunging Attacks in this state. When he uses Normal and Charged Attacks, they will be converted into Kuugo: Fushoudan and Kuugo: Toufukai respectively; the DMG they deal and their AoE will be increased, and their DMG will be considered Normal and Charged Attack DMG respectively. Kuugo: Toufukai will not consume Stamina.\\nThe Wanderer will hover persistently during this time. While this state is active, the Wanderer's movements gain the following properties:\\nÂ·Persistently consumes Kuugoryoku Points to maintain this hovering state.\\nÂ·When sprinting, additional Kuugoryoku Points will be consumed for the Wanderer to accelerate mid-air. Holding sprint will cause persistent Kuugoryoku Point consumption to maintain speed. This effect will replace his default sprint.\\nÂ·Jumping expends extra Kuugoryoku Points to increase hovering height. Holding jump will cause persistent Kuugoryoku Point consumption to keep increasing hovering height.\\n\\nRunning out of Kuugoryoku Points will end the Windfavored state.\\nA second cast during the duration of Windfavored will also end it.\\n\\n<i>\"The world dances in a weightless whirl, presenting a secret that can only be found in the flowers.\"</i>",
