                        "desc": "Begins the dance of faraway dreams and springs that hear, causing a Lotus of Distant Waters to bloom, dealing <color=#80C0FFFF>AoE Hydro DMG</color> based on Nilou's Max HP and applying the Lingering Aeon effect to all opponents hit.\\nAfter an interval, opponents affected by Lingering Aeon will take <color=#80C0FFFF>Hydro DMG</color>.\\n\\n<i>\"We have never witnessed that distant dream, but this dance can bring it to life.\"</i>",
