                        "desc": "Hurls Ushi, the young akaushi bull and auxiliary member of the Arataki Gang, dealing <color=#FFE699FF>Geo DMG</color> to opponents on hit. When Ushi hits opponents, Arataki Itto gains 1 stack of Superlative Superstrength.\\n\\nUshi will remain on the field and provide support in the following ways:\\nÂ· Taunts surrounding opponents and draws their attacks.\\nÂ· Inherits HP based on a percentage of Arataki Itto's Max HP.\\nÂ· When Ushi takes DMG, Arataki Itto gains 1 stack of Superlative Superstrength. Only 1 stack can be gained in this way every 2s.\\nÂ· Ushi will flee when its HP reaches 0 or its duration ends. It will grant Arataki Itto 1 stack of Superlative Superstrength when it leaves.\\n\\n<color=#FFD780FF>Hold</color>\\nAdjust throwing angle.\\n\\nUshi is considered a <color=#FFE699FF>Geo construct</color>. Arataki Itto can only deploy 1 Ushi on the field at any one time.\\n\\n<i>The name of this technique is derived from Onibudou (a light novel series written by Junkichi). However, calling it \"Onisatsu Zetsugi\" probably constitutes copyright infringement â€” not to mention how Itto himself is an oni and all...</i>",
