                        "is_unlock": true,
                        "name": "Pounding Surprise",
                        "is_enhanced": true,
                        "enhanced_desc": "When Klee's Elemental Skill <color=#FFD780FF>Jumpy Dumpty</color> and Normal Attacks deal DMG, there is a 50% chance to grant her an Explosive Spark. Using her Elemental Skill <color=#FFD780FF>Jumpy Dumpty</color> or Elemental Burst <color=#FFD780FF>Sparks 'n' Splash</color> also grants 1 Explosive Spark. Klee can hold up to 3 Explosive Sparks.\\nWhile holding an Explosive Spark, Klee's Charged Attack will consume 1 Spark to perform a special stamina-free Charged Attack, Boom-Boom Strike, dealing 50% increased DMG.\\n\\n<color=#FFD780FF>Hexerei: Secret Rite</color>\\nDuring the duration of Klee's Elemental Burst <color=#FFD780FF>Sparks 'n' Splash</color>, her Normal Attack sequence does not reset. If Klee holds an Explosive Spark while performing Normal Attacks, the third attack in the sequence will consume 1 Spark to unleash an additional attack equivalent to Boom-Boom Strike.",
