                        "desc": "Condensing ice to create The Steambird's signature, Charlotte creates a Newsflash Field that will deal <color=#99FFFFFF>AoE Cryo DMG</color> and restores HP for all nearby party members based on Charlotte's ATK.\\n<color=#FFD780FF>Newsflash Field</color>\\nÂ·While the ability is active, Monsieur Verite will deal <color=#99FFFFFF>Cryo DMG</color> at intervals to opponents within its AoE.\\nÂ·Will continuously restore HP to active character(s) within its AoE based on Charlotte's ATK.\\n\\n<i>\"Hearing stories from multiple perspectives to recreate what really happened is key to a good report... I mean, that's how you can pick the best angle for your article!\"</i>",
