                        "skill_type": 1,
                        "level": 13,
                        "desc": "Calls upon \"Yuegui: Throwing Mode,\" a special device created by a certain adeptus to help Yaoyao solve her problems.\\nThis skill will be used differently in Holding Mode.\\n\\n<color=#FFD780FF>Hold</color>\\nEnters Aiming Mode to adjust the throw direction.\\n\\n<color=#FFD780FF>Yuegui: Throwing Mode</color>\\nThrows out White Jade Radishes that will explode upon hitting characters or opponents, dealing <color=#99FF88FF>Dendro DMG</color> to opponents within a certain AoE, and healing characters within that same AoE based on Yaoyao's Max HP. If a radish does not hit either an opponent or a character, the radish will remain where it is and explode on contact with a character or opponent, or will explode after its duration expires.\\nYuegui: Throwing Mode will choose its radish-throw targets.\\nÂ·If all nearby characters have more than 70% HP remaining, then it will throw the radish at a nearby opponent.\\nÂ·If nearby characters have 70% or less HP remaining, it will throw a radish at the character with the lowest HP percentage remaining. If no opponents exist nearby, Yuegui will also throw White Jade Radishes at characters if they all have more than 70% HP and less than 100% HP remaining. Otherwise, it will throw radishes into the area at random.\\n\\nA maximum of 2 instances of Yuegui: Throwing Mode can exist at any one time.\\n\\n<i>\"A radish a day keeps trouble away! ... Oh, this isn't about a radish's medical properties, exactly, but it does have some health benefits, yeah!\"</i>",
