                        "skill_id": 10762,
                        "skill_type": 1,
                        "level": 13,
                        "desc": "Faruzan deploys a polyhedron that deals <color=#80FFD7FF>AoE Anemo DMG</color> to nearby opponents. She will also enter the Manifest Gale state.\\nWhile in the Manifest Gale state, Faruzan's next fully charged shot will consume this state and will become a Hurricane Arrow that contains high-pressure currents. This arrow deals <color=#80FFD7FF>Anemo DMG</color> based on the DMG of a fully charged Aimed Shot from \"Normal Attack: Parthian Shot.\"\\n\\n<color=#FFD780FF>Pressurized Collapse</color>\\nThe Hurricane Arrow will apply a Pressurized Collapse effect to the opponent or character hit. This effect will be removed after a short delay, creating a vortex that deals <color=#80FFD7FF>AoE Anemo DMG</color> and pulls nearby objects and opponents in. If the Hurricane Arrow does not hit any opponent or character, it will create a Pressurized Collapse effect at its point of impact.\\nThe vortex DMG is considered Elemental Skill DMG.\\n\\n<i>The winds of truth buffet the spirits of those who seek truth, dispersing the miasma of preconception.</i>",
