                        "skill_id": 10722,
                        "skill_type": 1,
                        "level": 8,
                        "desc": "Candace's fighting style is capable of warding off an entire tide of foes.\\n\\n<color=#FFD780FF>Tap</color>\\nRushes forward with her shield, dealing <color=#80C0FFFF>Hydro DMG</color> to opponents in front of her.\\n\\n<color=#FFD780FF>Hold</color>\\nRaises her shield to block incoming attacks from nearby opponents, forming a barrier that absorbs DMG based on her Max HP and absorbs <color=#80C0FFFF>Hydro DMG</color> 250% more effectively. This barrier lasts until the Elemental Skill is unleashed.\\nAfter holding for a certain period of time, Candace will finish charging, and when the skill button is released, the skill duration expires, or when the barrier is broken, she will perform a leaping strike that deals <color=#80C0FFFF>Hydro DMG</color> to opponents in front of her.\\n\\n<i>The oath of the guardians is more stalwart yet than the shields they inherit.</i>",
