                        "desc": "When your team has at least one <color=#FF9999FF>Pyro</color>, <color=#80C0FFFF>Hydro</color>, <color=#FFACFFFF>Electro</color>, or <color=#99FFFFFF>Cryo</color> character, the {LINK#N11240002}<color=#FFD780FF>Purrsonal Coordinated Assistance Robots</color>{/LINK} from the Elemental Burst <color=#FFD780FF>Hidden Aces: Seven Tools of the Hunter</color> will be enhanced based on the number of characters of each corresponding element.\\nJahoda secretly keeps track of these characters. Among them, the element with the highest number of characters determines the enhancement effect:\\nÂ· <color=#FF9999FF>Pyro</color>: <color=#FFD780FF>Purrsonal Coordinated Assistance Robots</color> deal 130% of their original DMG.\\nÂ· <color=#80C0FFFF>Hydro</color>: <color=#FFD780FF>Purrsonal Coordinated Assistance Robots</color> heal for 120% of their original healing amount.\\nÂ· <color=#FFACFFFF>Electro</color>: The number of <color=#FFD780FF>Purrsonal Coordinated Assistance Robots</color> increases by one.\\nÂ· <color=#99FFFFFF>Cryo</color>: The attack interval of <color=#FFD780FF>Purrsonal Coordinated Assistance Robots</color> is reduced by 10%.\\n\\nIf there's a tie between elements, the order of priority that determines which enhancement takes effect is: <color=#FF9999FF>Pyro</color>, <color=#80C0FFFF>Hydro</color>, <color=#FFACFFFF>Electro</color>, then <color=#99FFFFFF>Cryo</color>. Only one elemental effect can initially be triggered.",
