                        "skill_id": 11101,
                        "skill_type": 1,
                        "level": 1,
                        "desc": "<color=#FFD780FF>Normal Attack</color>\\nPerforms up to 3 consecutive spear strikes.\\n\\n<color=#FFD780FF>Charged Attack</color>\\nConsumes a certain amount of Stamina to lunge forward, dealing damage to opponents along the way.\\n\\n<color=#FFD780FF>Plunging Attack</color>\\nPlunges from mid-air to strike the ground below, damaging opponents along the path and dealing AoE DMG upon impact.\\n\\n<color=#FFD780FF>Nightsoul State: Swift Stormflight</color>\\nWhile in the Nightsoul's Blessing state: Iansan's Charged Attack will be transformed into the formidable Swift Stormflight, consuming a certain amount of Stamina to stomp fiercely down, dealing Nightsoul-aligned <color=#FFACFFFF>AoE Electro DMG</color>.",
