                        "skill_id": 10852,
                        "skill_type": 1,
                        "level": 1,
                        "desc": "Performs an upward thrust that deals <color=#99FFFFFF>Cryo DMG</color> and causes Freminet to enter Pers Timer for 10s.\\nWhile Pers Timer is active, his Elemental Skill will turn into Shattering Pressure.\\n\\n<color=#FFD780FF>Shattering Pressure</color>\\nExecutes different sorts of attacks based on the Pressure Level of Pers Timer, and then cancels Pers Timer.\\nÂ·Level 0: Unleashes a vertical cut, dealing <color=#99FFFFFF>Cryo DMG</color>.\\nÂ·Levels 1 to 3: Unleashes a vertical cut alongside Pers, dealing <color=#99FFFFFF>Cryo DMG</color> and Physical DMG. DMG dealt scales based on Pressure Level.\\nÂ·Level 4: Borrows the power of a fully-pressurized Pers to deal Physical DMG. Meanwhile, Normal Attack: Flowing Eddies will be replaced by Shattering Pressure.\\n\\n<color=#FFD780FF>Pers Timer</color>\\nWhen Freminet uses Normal Attacks, he will also unleash waves of frost that deal <color=#99FFFFFF>Cryo DMG</color> and increase Pers's Pressure Level.\\nThe accompanying <color=#99FFFFFF>Cryo DMG</color> dealt this way is considered Elemental Skill DMG.\\n\\n<color=#FFD780FF>Arkhe: Pneuma</color>\\nAt certain intervals, after using the upward thrust, a Spiritbreath Thorn in the form of another upward thrust will be created, dealing Pneuma-aligned <color=#99FFFFFF>Cryo DMG</color>.\\n\\n<i>To immobilize one's opponent without taking their life can also be considered something of a \"survival\" strategy that one may choose.</i>\\n<i>\"Pers... I leave the rest to you.\"</i>",
