                        "skill_type": 1,
                        "level": 1,
                        "desc": "Derives the ability to spur his teammates on from the recited prayers of the knightly order, regenerating HP for all nearby party members. This healing is based on Mika's Max HP and will grant them the Eagleplume state.\\n\\n<color=#FFD780FF>Eagleplume</color>\\nWhen the Normal Attacks of active characters affected by Eagleplume hit an opponent, Mika will help them regenerate HP based on his Max HP.\\nCharacters affected by this state can only regenerate HP in this way once per short interval of time.\\n\\n<i>\"Carry hope when in dire straits, and keep vigil when all is well... For that pure white plume shall at last guide the lost wayfarers.\"</i>",
